// Templates string

const nombre = 'Bryan Ariel';
const apellido = 'Sanchez Anariba';
const nombreCompleto = `${ nombre } ${ apellido }`;

console.log('Nombre Completo -> ', nombreCompleto);

function getSaludo() {
    return 'Hola Mundo';
}

console.log(`Este es un texto: ${ getSaludo }`);
